def plot_rrmse(selected_car, results, physics_only_rrmse):
    sizes = sorted(results.keys())
    xgb_rrmse = [
        np.median([result['rrmse'] for result in results[size] if result['model'] == 'Hybrid Model(XGBoost)'])
        for size in sizes
    ]
    lr_rrmse = [
        np.median([result['rrmse'] for result in results[size] if
         result['model'] == 'Hybrid Model(Linear Regression)'])
        for size in sizes
    ]
    only_ml_rrmse = [
        np.median([result['rrmse'] for result in results[size] if result['model'] == 'Only ML(XGBoost)'])
        for size in sizes
    ]

    plt.figure(figsize=(10, 6))
    plt.plot(sizes, xgb_rrmse, label='Hybrid Model(XGBoost)', marker='o')
    plt.plot(sizes, lr_rrmse, label='Hybrid Model(Linear Regression)', marker='o')
    plt.plot(sizes, only_ml_rrmse, label='Only ML(XGBoost)', marker='o')
    plt.axhline(y=physics_only_rrmse, color='r', linestyle='--', label='Physics Model')

    plt.xlabel('Number of Trips')
    plt.ylabel('RRMSE')
    plt.title(f'RRMSE vs Number of Trips for {selected_car}')
    plt.legend()
    plt.grid(True)

    plt.xscale('symlog', linthresh=700)
    plt.xticks(sizes, [str(size) for size in sizes], rotation=45)
    plt.xlim(min(sizes) - 10, max(sizes) + 1000)
    plt.show()

