def create_car_df(car, results, physics_only_rrmse):
    sizes = sorted(results.keys())
    data = {
        'Number of Trips': sizes,
        'Physics Only RRMSE': [physics_only_rrmse] * len(sizes)
    }
    models = ['Hybrid Model(XGBoost)', 'Hybrid Model(Linear Regression)', 'Only ML(XGBoost)']

    for model in models:
        data[model + ' RRMSE'] = [
            np.median([result['rrmse'] for result in results[size] if result['model'] == model])
            for size in sizes
        ]

    return pd.DataFrame(data)


# Creating a dataframe for each car
df_list = []
for car in results_dict.keys():
    df = create_car_df(car, results_dict[car], Physics_Only_RRMSE[car])
    df['Car'] = car
    df_list.append(df)

# Combining all dataframes into one
